INSERT INTO `faults` VALUES (2, 1, NULL, NULL, '2019-07-01 00:00:00', 2, '2019-07-01', 3, 'edge switch', 'Findings showed that the whole area of 16A OTL is having engaged tone. due to the findings, edge switch cant be remote to access it. Both of the uplink port of edge switch is blinking with amber.', 'Accessing edge switch directly. From the configuration of the port 1 and 2 uplink of the edge switch, we found that the configuration have been replaced with errors. The new configuration replaced the wrong VLAN for both port 1 and 2.\r\nthis happen on 26th June 2019 according to the syslog of the effected switch.', 2, 1, NULL, '2019-07-01 08:47:54', '2019-07-02 02:03:18');
INSERT INTO `faults` VALUES (10, 7, NULL, NULL, '2019-07-06 00:00:00', 1, '2019-07-06', 2, 'None', 'Complaint received from operation team regarding DTRS Low-No coverage. Time complaint: 1453 hrs. Unable to communicate using Fixed Radio & Portable Handheld Radio inside CCR-204 and surrounding area.', 'Email to P-14 iU&I team regarding the matter for their action. DTRS package not yet handover to Telecom PRPC UF.', 1, 1, NULL, '2019-07-06 08:11:24', '2019-07-06 08:11:24');
INSERT INTO `faults` VALUES (11, 6, NULL, NULL, '2019-07-06 00:00:00', 1, '2019-07-06', 5, 'Flammable Gas Alarm Triggered at FAR 131', 'Complaint received from Mr. Zulkepli today, regarding the Flammable Gas Alarm triggered at PAGA ZONE (PAGAZ-REFINERY-6) on 6.7.2019.\r\n\r\nThe Tag alarm not found in FGS HMI.', 'Performed investigation by Wan Cobra (Petronas Tech) & Sapez (Rites), found Flammable Gas Alarm triggered at PAGA ZONE (PAGAZ-REFINERY-6) area.\r\nFound that alarm triggered manually by unknown at PAGA Node Tag No : FAR131-PAG-721 System A (Engineer Panel).\r\n\r\nAlarm reset and all system working fine.', 2, 1, NULL, '2019-07-06 08:43:54', '2019-08-30 00:30:35');
INSERT INTO `faults` VALUES (12, 3, NULL, NULL, '2019-07-17 14:58:00', 1, '2019-07-17', 7, 'Telephone System', 'Found sounder beacon trigger 3 sec after hand hook off.', 'Need to configure inside Voice Gateway for \"no battery-reversal\"', 2, 1, NULL, '2019-07-17 07:16:57', '2019-07-17 07:37:43');
INSERT INTO `faults` VALUES (13, 1, NULL, NULL, '2019-07-27 17:20:00', 1, '2019-07-27', 8, 'Workstation', 'Upon opening web browser to retrieve the data, it takes about 15 to 20 minutes to display the data.', 'There is FUGRO apps reside within the workstation of WMS which always make a connection to the server. This to ensure that the server can provide the realtime data to the web server that is accessed by any workstation. This connection can be established by logging at the FUGRO apps.\r\nThis connection from the workstation to the server that is located at the same cabinet can be disconnect when someone remote to the server itself using Remote Desktop.\r\nTo fix this situation, the connection between FUGRO apps and the server need to be established by logging in the WMS workstation at the BLD810.', 2, 1, NULL, '2019-07-31 09:33:58', '2019-07-31 09:33:58');
INSERT INTO `faults` VALUES (14, 1, NULL, NULL, '2019-08-02 09:30:00', 1, '2019-08-02', 9, 'LAN Cable', 'Workstation cant make a ping. (No network)', 'Theres nothing wrong with the switch. Uplink (FO cable) was healthy (green LED blinking) meanwhile the downlink (CAT6 cable) was unhealthy (no LED blinking at all).  We will see the switch  port is disable due to cross cable.\r\nAfter an investigation, we found out that the patch cable is a cross (twist) cable. We advise them to change/fixed with a straight cable.\r\n\r\nthe downlink cat6 cable is not in our custody.', 2, 1, NULL, '2019-08-03 07:04:41', '2019-08-03 07:17:06');
INSERT INTO `faults` VALUES (15, 1, NULL, NULL, '2019-08-02 15:30:00', 1, '2019-08-03', 10, 'workstation', 'Workstation infected with virus. Complaint coming in from PETICT.', 'Clean the virus with Malwarebytes.', 2, 1, NULL, '2019-08-03 07:33:03', '2019-08-03 07:33:03');
INSERT INTO `faults` VALUES (16, 4, NULL, NULL, '2019-08-22 15:20:00', 2, '2019-08-23', 8, 'Dispatcher', 'PR was reported lost by the owner on 15 Aug 2019. M Naim B Khairul Anuar (OPERATIONS/PRPC) \r\nMobile  : 0175088428\r\nISSI        : 1010098\r\nS/N        : 123TTD0811\r\nTel          : 00016C1300932400\r\n                : MCB602-WTR-038\r\n 22 Aug 2019 the PR detected active on the network.\r\nI  did send a text and directly call but no reply from the user.', 'IF still no response from the user, the PR will disable from the network on 23 Aug 2019.', 2, 1, NULL, '2019-08-22 07:31:13', '2020-09-04 00:51:00');
INSERT INTO `faults` VALUES (17, 4, NULL, NULL, '2019-08-21 15:38:00', 2, '2019-08-23', 8, 'KVL', 'Preparation for KVL implementation.\r\nAttendees:\r\n1. Norhisham Laham\r\n2. Taufiq Haris\r\n3. Remy (Motorola)\r\n4. Hj Zainal....\r\n\r\nRemy integrates the KVL handheld into the AUC server. Setting the ports for AuC and PrC into the AUC server.\r\nUploading the K Key successful via KVL palm.\r\n3 units KVL successfully synchronize with AUC server.\r\nWe did the KVL downloading to PR and it failed, the AUC server didn\'t recognize the PR. after checking we found the PR is not compatible to do the encryption , Firmware is required .\r\nOn BTS side still no syncho between sites and AUC server. Remy able to bring up the BTS into AUC server but required 5 days to do that.', 'Hj Zainal proposed to purchase the Firmware to upload on each PR to  AiE compatible and will request Remy to solve the BTS encryption issue to synchronize between BTS and MSO', 2, 1, NULL, '2019-08-22 07:52:41', '2020-09-04 00:48:47');
