INSERT INTO `faults` VALUES (36, 8, NULL, NULL, '2019-08-22 14:13:00', 3, '2019-08-31', 32, '4120-SHL-401', 'Air Conditioning number 2 not working - Not Cool, just blown hot air.', 'Require to inform Electrical / HVAC team to perform , check and service indoor and outdoor A/C unit.\r\n\r\nIf possible need to service both air cond and re setting timer.', 2, 1, NULL, '2019-08-27 06:17:49', '2020-08-05 10:13:59');
INSERT INTO `faults` VALUES (37, 4, NULL, NULL, '2019-08-24 18:10:00', 3, '2019-08-27', 32, 'BDA', 'Interference issue due to ROA( Random Access Opportunity ) increased to 91%  , PTT problem can\'t make a call and breaking voice quality.\r\n\r\nTroubleshooting method:\r\n1. Login on NMT password - A1b2C3d$\r\n1. checking on NMT ( Zone watch app)\r\n2. Login on MTS4 with BTS service SW IP:  \r\n10.128.1.1 twr 1\r\n10.128.2.1 twr 2\r\n10.128.3.1 twr 3\r\n10.128.4.1 twr 4\r\n\r\nSC: status bts\r\nSC: attrib\r\nSC: port\r\n\r\nclose \r\n\r\nChecking BR on IP  if tower 1\r\n10.128.1.1  :18011   - BR1\r\n10.128.1.1 :18012    - BR2\r\n10.128.1.1 :18013    - BR3\r\n10.128.1.1 :18014    - BR4\r\n\r\n\r\nBR) get info\r\nBR) get status\r\nBR) get pa_status\r\nBR) rssicnt \r\nBR) chanstat\r\nBR) get tx_freq\r\nBR) get rx_freq\r\nBR) get fp\r\nBR) get rp\r\nBR) get vswr \r\n\r\nWe found new installed BDA was power up without setting suitable RF power and notify PRPC UF', 'Immediately turned off the new installed BDA , after 5 minutes the zone watch showed no interference on RAO level.', 2, 1, NULL, '2019-08-27 06:44:03', '2019-08-27 06:44:03');
