INSERT INTO `faults` VALUES (39, 8, NULL, NULL, '2019-08-28 14:47:00', 3, '2019-09-07', 24, 'SHL 401 DTR 736', 'Air conditioning failure for AC number 2.\r\n\r\n#need to be check and service - cause tripping DTRS equipment due to high temperature\r\nA/C number 2 runs with only blows air which are hot .', 'Need to inform area owner , electrical , hvac team to resolve this matters.\r\n\r\nPIC Building Custodian: Farhana UF , Mobile number 012-7049371\r\n\r\nattended site visit on 4th October _ En Amirul from Alpine Utility , mobile no 017-7745688\r\n\r\nResolve by Alppine Utility on 7th October.\r\nDate : 07 / 10 / 2019\r\nDay : Tuesday\r\n\r\nClient : PRPC\r\nLocation : Pengerang\r\n\r\nTROUBLESHOOTING\r\n\r\n1) Unit : Split Unit\r\nmodel :\r\nSerial no. :\r\nUnit tag no : SHL401-ACP-002\r\nLocation : SHL 401\r\n\r\nJob description\r\n- Prepair equipment tooling \r\n- Off supply MCB unit\r\n- Charging nitrogen 150psi - 250psi\r\n- Check leaking at piping outdoor to indoor\r\n- Check leaking piping outdoor compressor\r\n- Check leaking piping condenser fin\r\n- Breazing piping leaking\r\n- Hold pressure nitrogen 250psi 30 minute\r\n- Throw pressure nitrogen \r\n- Vacum piping 15 minute\r\n- Charging gas refrigerant to 120psi \r\n- Check ampere\r\n- Set timer rotate 4hour\r\n- Unit now running auto\r\n- moniter unit\r\n\r\nFinding\r\nA) Found leaking at condenser fin \r\n\r\nPLANNED PREVENTIVE MAINTENANCE\r\n\r\n1) Unit : Split Unit\r\nmodel :\r\nSerial no. :\r\nUnit tag no : SHL401-ACP-001\r\n                      SHL401-ACP-002\r\nLocation : SHL 401\r\n\r\nJob description\r\n\r\n- Clean condensor fin\r\n- Clean condensor fan\r\n- Cleaning filter\r\n- Check running pressure\r\n- Clean indoor body\r\n- Check running load amp\r\n\r\n\r\nRemark\r\nA) Attend complain unit leak SHL 401 job done\r\n\r\nManpower\r\nA) Saifullah\r\nB) Hafizh \r\nC) Wan Mazuri\r\n\r\nVehicle\r\nJCT 555', 2, 1, NULL, '2019-08-28 06:56:37', '2019-10-10 01:30:39');
