INSERT INTO `faults` VALUES (41, 3, NULL, NULL, '2019-09-02 08:58:00', 2, '2019-09-17', 8, 'Migration Activities by PET ICT between DATA CENTER and DCR701', 'Telecom PRPC UF to provide temporary link/route A & B from DCR701 to BLD810.\r\n -Total Link/Route 16 pairs / 32 cores.\r\n -Permanent cores 2 pairs / 4 cores route A & B\r\n -Temporary cores 8 pairs / 16 cores route A\r\n\r\n23/9/2019 - PICT report core 7,8 and 75,76 problem', '1-Patching activities and cores tested completed.\r\n2-For temporary cores 8 pairs / 16 cores to use until end of this year 2019 (PET ICT to advise) \r\n3-Refer to attachment.\r\n\r\n2/10/2019\r\nTroubleshooting 4 cores link from DCR701 to BLD810 Route A\r\n1- Clean all connector patchcord and FFP.\r\n2- Cores 7,8 found 1 pair connector at MCB602 not connected properly. Check and test dB loss the link with fluke get result (4.99 dB, 5.48 dB). Result Test Pass.\r\n3- Cores 75,76 found 1 link from WMF  to TER at BLD 810 for core 75 problem. Result test for dB Loss (9.60 dB) Fail. For this connection change to cores 77,78. Tested OK', 1, 1, NULL, '2019-09-19 01:49:09', '2019-10-05 01:50:17');
INSERT INTO `faults` VALUES (42, 4, NULL, NULL, '2019-09-20 10:23:00', 2, '2019-09-27', 3, 'BDA', 'BDA installation table attached.\r\n3 more BDA powering up activities on hold due to PTW no approve yet.', 'BDA commisioning and working completed', 2, 1, NULL, '2019-09-20 02:26:57', '2020-09-04 00:34:20');
INSERT INTO `faults` VALUES (43, 4, NULL, NULL, '2019-09-20 10:27:00', 2, '2019-10-04', 8, 'STS/ATS power redundancy installation', 'JHA and MOS not yet approved\r\nInstallation drawing received on going review not approve yet\r\nATS not arrive yet , Protellus can\'t find it in the warehouse.\r\nItems like TB , circuit breaker and gland was found in the warehouse.\r\nNext week Protellus team will update the status .', NULL, 2, 1, NULL, '2019-09-20 02:35:27', '2020-09-02 00:29:24');
INSERT INTO `faults` VALUES (44, 3, NULL, NULL, '2019-09-23 23:44:00', 3, '2019-09-30', 165, 'SMK SYSTEM (TM JPB)', 'There is a SMK to be installed at TOB in this week by TM. TM are required 2 cores FOC for each Route A and B from TM SDF, BLD810 to TOB, SPTS (a.k. SPJ).', 'Completed lay and terminated.\r\nTested by JPB and TM link working properly on 30.9.2019', 2, 1, NULL, '2019-09-26 15:57:49', '2019-10-01 01:53:28');
INSERT INTO `faults` VALUES (45, 3, NULL, NULL, '2019-09-26 09:45:00', 3, '2019-09-30', 100, 'CABINET', 'OUI report one of the CCTV Cabinet (FAR142-CTV-731) on the off position and will effect 13 nos camera cannot view and monitor at the field.\r\n\r\nDuring the troubleshoot on the CCTV cabinet found:\r\n1- FAR142-CAM-001 -Power cable to field device have short to ground\r\n                                    -Cable blue to ground (0.2 ohm)\r\n                                    -Cable brown to ground (28.8 ohm)\r\n                                    -action: (Prefchem to rectify)\r\n2- 1430-CAM-004  - Camera unit at Field faulty\r\n                                - action: (Prefchem and vendor to rectify)', 'Telecom UF power up back the CCTV Cabinet (FAR142-CTV-731) with isolated 2 main circuit breaker for camera FAR142-CAM-001 and 1430-CAM-004. All 11 nos out of 13 nos camera working in a good condition.', 2, 1, NULL, '2019-09-30 02:10:20', '2020-08-04 00:11:30');
INSERT INTO `faults` VALUES (46, 5, NULL, NULL, '2019-09-19 17:15:00', 2, '2019-10-03', 92, 'UPS Isolator Switch', 'on 19 september 2019 when we do commissioning for ACS we found out that 1 of our CCTV interface with ACS on off position.\r\nThen we check on panel site we found out that our CCTV panel inside FAR 121 was in off position.\r\nOur finding as below,\r\n\r\n1. Isolator switch inside CCTV panel on OFF position.\r\n2. Check UPS power, UPS no power.\r\n3. Check Internal CCTV panel, all in good condition.\r\n4. Move to incoming power at PDB 604 found MCB for CCTV panel in OFF position without LOTO.', 'CCTV Panel\r\na) Physical check > all in good condition\r\nb) Connection check > all in good condition\r\nc) Continuity test to ground and core to core \r\n> Finding camera SUB121-CAM-001 core to core (blue + earth) got continuity.\r\n> On morning 3/10/19 Vendor and P2 go to site to find the problem found core brown inside JB at field area disconnected and touch the other core, and this cause the cable shorted.\r\nd) Magger cable from PDB604 to CTV731 to ensure incoming cable in good position.\r\nd) after all in good condition on 3/10/19 at 5 pm power up back CCTV panel\r\ne) Check all the video all in good view', 2, 1, NULL, '2019-10-03 09:32:50', '2019-10-03 09:32:50');
INSERT INTO `faults` VALUES (47, 8, NULL, NULL, '2019-10-05 09:20:00', 2, '2019-10-05', 101, 'FAR 151 PAG 722 , 724', 'Clear Punchlist for defect LTU.\r\nFAR 151\r\na.Loop 15B\r\nLTU 1753 - tukar LTU\r\nID FAR151-LSU-010\r\n\r\nb.Loop 16B\r\nLTU 1347 - tukar LTU \r\nID SUB 151 -LSU-002\r\n\r\nc.Loop 18B\r\nLTU 1463- tukar LTU\r\nID SUB 112 -LSU-002', 'Rites \r\nPIC : Aliff\r\na. Change LTU\r\nb. Setting and run healthiness \r\nc. Site test - paga alarm sound test, monitor at field.', 2, 1, NULL, '2019-10-06 01:28:02', '2019-10-06 02:17:22');
INSERT INTO `faults` VALUES (48, 8, NULL, NULL, '2019-10-06 09:34:00', 2, '2019-10-12', 8, 'BLD810-CTV-731', 'Washer pipe detached from wiper hose.', 'PRPC Telecom need to inform construction - this issue alreary being brought up a few month back.\r\n\r\nStill no action taken.', 2, 1, NULL, '2019-10-06 02:12:21', '2020-08-04 00:18:03');
INSERT INTO `faults` VALUES (49, 8, NULL, NULL, '2019-10-08 16:43:00', 2, '2019-10-31', 67, 'FON CABINET', 'OTDR Testing for cables GHB801-X-BLD810-001A from GHB801 to BLD810\r\n\r\nfindings  - 1 JB install due to cables shortages/cuts\r\n8 cores downstream test by MIE1300 found traces over acceptables limits\r\n\r\nAllowable limit \r\nsplice : o.3db\r\nconnector: 0.5db\r\na. Core 8 - 0.357db\r\nb. Core 13- 0.9db\r\nc. Core 12-1.32db\r\nd. Core23 - 1.0db\r\ne. Core 28- 0.5db\r\nf. Core 31 - 0.327db\r\ng. Core 37- 4.691db\r\nh. Core 38-0.653db\r\ni. Core 40 - 1.1db', 'Waiting for upstream OTDR test by SYS', 2, 1, NULL, '2019-10-08 08:55:32', '2020-08-04 00:11:01');
INSERT INTO `faults` VALUES (50, 8, NULL, NULL, '2019-10-09 09:36:00', 3, '2019-10-31', 67, 'GHB801 FON 701', 'OTDR testing carried out upstream from GHB 801 to BLD \r\n\r\nResults: 1-30 cores above 0.1 db loss\r\n\r\nTest Carried out by : Inteqno \r\nTester : Syafiq HP 0193989150', 'Witness by Telecom PRPC UF,\r\n\r\nInform Mr. Asraf SYS 0194604925 regarding high loss above allowable limits.\r\n\r\nSYS Quality Assurance Team and Engineering to provide solution.\r\n\r\nLink Loss = [fiber length (km) x fiber attenuation per km] + [splice loss x # of splices] + [connector loss x # of connectors] + [safety margin]\r\n\r\nClosed : After rectification works by SYS Contractor.\r\nResults submit to Team project P36. Final documentation and result shall be submit to UF Telecom for review\r\n\r\n*Link Budget* \r\nFor example, Assume a ___km single mode link at 1310nm with 2 connector pairs and 1 splices.\r\n\r\n\r\nLink Loss = [__km x 0.4dB/km] + [0.1dB x 1] + [0.75dB x 2] + [3.0dB] = ____dB\r\n\r\nIn this example. an estimated ___dB of power would be required to transmit across this link. Of course, it is very important to measure and verify the actual link loss values one the link is established to identify any potential performance issues.', 2, 1, NULL, '2019-10-10 01:54:16', '2020-08-04 00:21:06');
INSERT INTO `faults` VALUES (51, 8, NULL, NULL, '2019-10-12 16:08:00', 2, '2019-10-31', 100, 'FAR 142 PAG722/ FAR 142 PAG724', 'FAR 142 PAG722\r\nLoop 4A\r\nIsolated - link open 13,14,15 & 16\r\n\r\nFAR 142 PAG724\r\nLoop 11B\r\nTSA2, TB 41,42', 'FAR 142 \r\n\r\nPRPC UF need to clarify with Project Team, PL for this site.\r\n\r\nsuspect cable faulty due alarm will appear after a while resetting alarm.\r\n\r\n* To check who open the knife switch (loop being isolated)', 2, 1, NULL, '2019-10-12 08:31:55', '2020-08-04 00:10:35');
INSERT INTO `faults` VALUES (52, 8, NULL, NULL, '2019-10-14 16:16:00', 2, '2019-10-31', 150, 'PAG721 - PAG723', '1. FAR 330 - PAG721 System A\r\na. AMP 1 - Line Fault/earth fault\r\nb. AMP 2 - Line Fault\r\nc. AMP 3 - Line Fault/earth fault\r\ne. AMP 5 - Line Fault\r\nf. AMP 10 -  Line Fault\r\ng. AMP 11 - Line Fault\r\n\r\n\r\n2. FAR 330 - PAG723 System B\r\na. AMP 2 - Line Fault\r\nb. AMP 10- Line Fault\r\nc. AMP 11 - Line Fault\r\nd. AMP 12 - Line Fault', 'This alarm appears after resetting alarm.\r\n\r\nsuspected, cable leakage to earth during raining / leaks to speaker terminations box\r\ncable gland or cable isulation damage.\r\n\r\nTelecom UF need to raise this issue to Rites, IU&I projects team and EPCC.\r\n(Equipments/Cables under EPCC)', 2, 1, NULL, '2019-10-14 08:28:02', '2020-07-29 01:29:01');
INSERT INTO `faults` VALUES (53, 8, NULL, NULL, '2020-06-16 13:11:00', 2, '2020-06-18', 165, 'FON 701', 'Reported back bone high lost:\r\n\r\nComplainer: SPJ', '*Link Budget*\r\nLink Loss = [fiber length (km) x fiber attenuation per km] + [splice loss x # of splices] + [connector loss x # of connectors] + [safety margin]\r\n\r\nFor example, Assume a ___km single mode link at 1310nm with 2 connector pairs and 1 splices.\r\n\r\nLink Loss = [__km x 0.4dB/km] + [0.1dB x 1] + [0.75dB x 2] + [3.0dB] = ____dB\r\nIn this example. an estimated ___dB of power would be required to transmit across this link. Of course, it is very important to measure and verify the actual link loss values one the link is established to identify any potential performance issues.\r\n\r\nTesting OLTS from BLD 701 (SPJ) to BLD810 via MCB 602\r\nTotal Distance : 9.14km\r\nSplice : 4 nos\r\nConnector : 5\r\nSafety Margin: 3\r\n\r\nLink Loss = [__km x 0.4dB/km] + [0.1dB x 1] + [0.75dB x 2] + [3.0dB] = ____dB\r\nLink Loss = [9.14km x 0.4dm/km] +[0.1db x 4] + [0.75db x 5] + [0 db -not includedsafety margin]\r\n\r\nLink Loss:[ 3.656]+[0.4] + [3.75]+ [0 db -not includedsafety margin]\r\nLink Loss: 7.806db\r\n\r\nsince the testing result :-\r\ni. Leg A = 5.17db\r\nii. Leg B= 4.41db\r\n\r\nResults below expected link budget calculation', 2, 1, NULL, '2020-06-22 05:29:10', '2020-06-22 05:29:10');
INSERT INTO `faults` VALUES (54, 5, NULL, NULL, '2020-08-03 15:01:00', 1, '2020-08-10', 100, 'Encoder', 'Ref Ticket ID:  A77-37Q-VX1Z\r\nSubject: 1420-CAM-005 : CCTV - Rectification For Faulty CCTV\r\n\r\n1. Junction Box Condition \r\n2. Cable to field device \r\n\r\nFindings :\r\nVideo Intermittent', 'Solution :\r\n1. Swap FO cable at FO card to the ok camera and monitor the video as good condition.\r\n2. Change FO card with spare and monitor the video again but still same.\r\n3. Change coax cable at encoder to the good condition camera finding ok. but the other camera which is good condition previously to the faulty port, finding the connection loss.\r\n5. Need to change encoder with spare encoder.', 1, 1, NULL, '2020-08-03 07:06:54', '2020-08-03 07:06:54');
INSERT INTO `faults` VALUES (55, 5, NULL, NULL, '2020-08-03 15:09:00', 1, '2020-08-10', 99, 'Field Internal Junction Box', 'Ref Ticket ID: 9HZ-YPW-ZG8Z\r\nSubject: 1220-CAM-007 : CCTV - Rectification For Faulty CCTV\r\n\r\n\r\n1. Junction Box Condition \r\n2. Cable to field device \r\n3. Camera Condition ( Not sure due to Prefchem have no tools to check)\r\nFindings :\r\nVideo loss / no video', 'Solution :\r\n1. Swap FO cable at FO card to the ok camera and monitor but there was no video also.\r\n2. Change FO card with spare and monitor the video again but still same. and video present LED off.\r\n3. Need rectify more on field site since the data for video present faulty.(Prefchem)', 1, 1, NULL, '2020-08-03 07:13:22', '2020-08-03 07:13:22');
INSERT INTO `faults` VALUES (56, 5, NULL, NULL, '2020-08-03 15:23:00', 2, '2020-08-10', 48, 'Outdoor Unit', 'Ref Ticket ID: H1B-HRN-P7V8\r\nSubject: SUB551: 8835-OTL-001 not functioning\r\n\r\n1. No dial tone.\r\n2. Beacon sounder trip.\r\n3. Signal cable connected to telephone, cause voltage drop looks like cable shorted.\r\n4. Power JB and signal JB got water ingress.\r\n5. Open beacon and sounder enclosure finding board already damage and water full inside.', '1. Change with new spare for all outdoor equipment.\r\n2. Once install to ensure no more water ingress in future (silicon added)', 2, 1, NULL, '2020-08-03 07:29:19', '2020-11-26 00:56:49');
INSERT INTO `faults` VALUES (57, 7, NULL, NULL, '2020-09-11 08:44:00', 2, '2020-12-11', 1, 'PAC', 'Ref Ticket ID: L83-SBT-3953\r\n\r\n	Inspection conducted on 9th September 2020\r\n	Inspection carried out with Rites Team\r\n\r\n\r\n1.	Investigation issue raise on MCB601-PAC-017 (CCR101) PTT announcement and Alarm malfunction for Manual and Auto.\r\na. Upon check and inspection for MCB601-PAC-017, all wiring termination is correct as per wiring diagram.\r\nb. Open the Access Panel and check the wiring inside the Access Panel termination and ribbon cable is correct and no cable nor wire loose or disconnected.\r\n\r\n2.	CTR100 PAGA MDF Cabinet (TSE-17)\r\na. Check the at TSE-17 for Access Panel termination is correct as in the wiring diagram and no cable loose found at the TB.\r\n\r\n\r\n3.	Team already performed hard reset and tested the access panel, but still malfunction on system A.', 'The solution needs to send back to further investigation send back to repair.', 1, 1, NULL, '2020-11-26 00:54:26', '2020-11-26 01:04:43');
INSERT INTO `faults` VALUES (58, 8, NULL, NULL, '2020-11-30 15:57:00', 3, '2020-12-31', 67, 'GHB801-RVS-739', '30/11/2020\r\n\r\nPRPC Infra / CFSM engage contactor to excavate and manual digging to trace faulty cable estimate at 333meter from BLD801 to field equipment.\r\n\r\nFindings:-\r\n\r\nFound 5 laid cable in this area.\r\n2 power cables\r\na. 1 length to FE 04\r\nb. 1 length to FE 05\r\n3 FO cables\r\na. 1 length to FE 04\r\nb. 1 length to FE 05\r\nc. 1 length to BLD810\r\n\r\nNo cable tagging found!\r\n\r\nVisual inspection found out 2 cables totally cut\r\na. Earthing cable - totally broken\r\nb. FO cables - totally cut/broken\r\nc. 1 length power cables outer layer damage and burn marks could easily being seen.\r\nd. 1 spot of 1 length of FO cable outer layer damage.', 'INO Team need to engage contractor to repair the cable fault.\r\n\r\ninfo from HOD Telecom  - Mr Aswan', 1, 1, NULL, '2020-12-08 08:00:56', '2020-12-08 08:00:56');
INSERT INTO `faults` VALUES (59, 3, NULL, NULL, '2020-12-14 08:38:00', 1, '2020-12-24', 165, 'PPM PAGA Alarm Test for (AUTO) from Instrument  (JT8-5Q1-8ZDP/ W2S-GSA-TUBY)', 'Pending PPM PAGA Alarm test for (AUTO) from Instrument (SPTs). \r\nTo trigger from FAP at BLD701 and SUB751.', 'SPTs to check and confirm due to trigger alarm requirement at SPJ', 1, 1, NULL, '2020-12-14 00:45:52', '2020-12-14 01:04:32');
INSERT INTO `faults` VALUES (60, 3, NULL, NULL, '2020-12-24 08:46:00', 1, '2020-12-24', 171, 'PPM PAGA Alarm Test (Manual) from PAC at BLD701 ( JT8-5Q1-8ZDP/ W2S-GSA-TUBY)', 'During manual alarm activities finding not trigger all alarm and PTT announcement for system A at SUB751.', 'Rites to check on the PAGA System on configuration for amplifier assignment.', 1, 1, NULL, '2020-12-14 00:57:58', '2020-12-14 01:04:10');
