INSERT INTO `faults` VALUES (78, 13, 'FAR420: HIGH VALUE FOR VSWR ON THE BDA', '1349', '2021-06-29 00:15:00', 2, '2021-07-01', 14, 'BDA', 'On 29th June 2021, at 1215hrs, FPSSB team performed plan preventive maintenance for Bi-Directional Amplifier (BDA) at building FAR-420. Visual and physical checking on junction box, BDA and antenna is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is high.\r\n\r\nPlease refer to attached report for further information.', '1. Monitor the trending of VSWR for the next year PPM.\r\n2. Check the drawing for the cable path and inspect the condition of the RF cable or connectors.\r\n3. Require further investigation on this issue.', 1, 1, NULL, '2021-06-30 16:17:47', '2021-06-30 16:17:47');
INSERT INTO `faults` VALUES (79, 13, 'FAR630: HIGH VALUE FOR VSWR ON THE BDA', '1356', '2021-06-30 11:33:00', 2, '2021-07-01', 3, 'BDA', 'On 30th June 2021, at 1100hrs, FPSSB team performed plan preventive maintenance for Bi-Directional Amplifier (BDA) at building FAR-630. Visual and physical checking on junction box, BDA and antenna is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is high.', '1. Monitor the trending of VSWR for the next year PPM.\r\n2. Check the drawing for the cable path and inspect the condition of the RF cable or connectors.\r\n3. Require further investigation on this issue.', 1, 1, NULL, '2021-06-30 16:34:19', '2021-06-30 16:34:19');
INSERT INTO `faults` VALUES (80, 13, 'FAR131: HIGH VALUE FOR VSWR ON THE BDA', '1363', '2021-07-01 00:00:00', 1, '2021-07-02', 5, 'BDA', 'On 1st July 2021, at 1100hrs, FPSSB team performed plan preventive maintenance for BiDirectional\r\nAmplifier (BDA) at building FAR131. Visual and physical checking on junction box, BDA and antenna is in\r\ngood condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is high.\r\n\r\nPlease refer to attached report for further information.', '1. Monitor the trending of VSWR for the next year PPM.\r\n2. Check the drawing for the cable path and inspect the condition of the RF cable or connectors.\r\n3. Require further investigation on this issue.', 1, 1, NULL, '2021-07-01 07:49:17', '2021-07-03 06:17:51');
INSERT INTO `faults` VALUES (81, 13, 'SUB131: HIGH VALUE FOR VSWR ON THE BDA', '1364', '2021-07-01 00:00:00', 1, '2021-07-04', 88, 'BDA', 'On 1st July 2021, at 1100hrs, FPSSB team performed plan preventive maintenance for Bi-Directional Amplifier (BDA) at building SUB-131. Visual and physical checking on junction box, BDA and antenna is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is high.', '1. Monitor the trending of VSWR for the next year PPM.\r\n2. Required to order/install new tagging.\r\n3. Check the drawing for the cable path and inspect the condition of the RF cable or connectors.\r\n4. Require further investigation on this issue.', 1, 1, NULL, '2021-07-05 13:24:10', '2021-07-05 13:36:01');
INSERT INTO `faults` VALUES (82, 13, 'FAR132: NO COVERAGE SIGNAL INSIDE BUILDING', '1367', '2021-07-02 00:00:00', 3, '2021-07-05', 87, 'BDA', 'On 2nd July 2021, at 1650hrs, FPSSB team performed plan preventive maintenance for Bi-Directional Amplifier (BDA) at building FAR-132. Visual and physical checking on junction box, BDA and antenna is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is very high and no signal coverage inside building.', '1. Need to active REM for this issue.\r\n2. Please refer to attached summary report for planning to rectify this issue.', 1, 1, NULL, '2021-07-05 14:20:45', '2021-07-05 14:50:49');
INSERT INTO `faults` VALUES (83, 13, 'SUB132: HIGH VALUE FOR VSWR ON THE BDA', '1368', '2021-07-02 17:15:00', 1, '2021-07-05', 89, 'BDA', 'On 2nd July 2021, at 1715hrs, FPSSB team performed plan preventive maintenance for Bi-Directional Amplifier (BDA) at building SUB-132. Visual and physical checking on junction box, BDA and antenna is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that high VSWR value on donor antenna.', '1. Monitor the trending of VSWR for the next year PPM.\r\n2. Require further investigation on this issue.', 1, 1, NULL, '2021-07-05 15:18:33', '2021-07-05 15:18:33');
INSERT INTO `faults` VALUES (84, 12, 'CMH180-FON-701', 'EWN-7XD-VGUX', '2021-07-07 00:00:00', 2, '2021-07-31', 77, 'FON', 'During PPM on 6th July 2021, found the following findings :\r\n\r\n1. Hole at gland plate\r\n2. FPP-001 & 002: FO with no tags hanging macam tu je.\r\n3. FPP-801 missing patch panel female ports.\r\n\r\nBy Tim/Mark & Ludfi', 'Proposed solution:\r\n1. Seal with either duct seal compound or blank plug.\r\n2. Propose to either remove it from panel or hide it in the trunking.\r\n3. To install when consumables arrive. \r\n\r\nRegards.\r\nTimothy Nelson', 2, 1, NULL, '2021-07-07 02:29:20', '2021-10-11 00:46:05');
INSERT INTO `faults` VALUES (85, 12, 'CMH801-FON-701 Cat6 cable flying', 'ADA-UV2-GJY2', '2021-07-07 00:00:00', 2, '2021-07-31', 26, 'FON', 'During the PPM on 6th June, found 1 nos Cat6 cable entering panel thru top gland plate with no gland.', 'Propose to either:\r\n1. Rectify the cable installation on our own, or\r\n2. Escalate to the relevant parties for them to make good.', 2, 1, NULL, '2021-07-07 02:39:21', '2021-10-11 00:46:43');
INSERT INTO `faults` VALUES (86, 13, 'FAR521: HIGH VALUE FOR VSWR ON THE BDA', '1377', '2021-07-08 11:05:00', 1, '2021-07-10', 125, 'BDA', 'On 8th July 2021, at 1100hrs, FPSSB team performed plan preventive maintenance for BiDirectional\r\nAmplifier (BDA) at building FAR521. Visual and physical checking on junction box, BDA and antenna is in\r\ngood condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is high.\r\n\r\nPlease refer to attached report for further information.', 'ANTENNA DONOR\r\n	Approximately 26 meters from BDA. Required to check on connector antenna at rooftop building.\r\n\r\nANTENNA INSIDE BUILDING\r\n	Approximately 5 meters from BDA suspected connector or RF cable problem before reach to splitter.', 1, 1, NULL, '2021-07-08 16:07:16', '2021-07-08 16:07:16');
INSERT INTO `faults` VALUES (87, 13, 'SHL801: HIGH VALUE FOR VSWR ON ANTENNA SYSTEM FIXED RADIO & MARINE RADIO', '1360', '2021-07-12 22:01:00', 1, '2021-07-13', 65, 'Fixed Radio & Marine Radio', 'On 12th July 2021, at 1130hrs, FPSSB team performed plan preventive maintenance for fixed radio and marine radio at Shelter SHL-801. Visual and physical checking on fixed radio and marine radio is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that high VSWR value on antenna fixed radio and antenna marine radio.', '1. To troubleshoot and rectify on connector at antenna fixed and marine radio on the top of tower.', 1, 1, NULL, '2021-07-13 14:03:38', '2021-07-13 14:03:38');
INSERT INTO `faults` VALUES (88, 13, 'SUB122: No Power Voltage for BDA', '1436', '2021-07-27 00:00:00', 1, '2021-08-06', 96, 'BDA', 'On 27th July 2021, at 1550hrs, FPSSB team performed plan preventive maintenance for BiDirectional\r\nAmplifier (BDA) at building SUB122. Visual and physical checking on junction box, BDA and antenna is in\r\ngood condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is high and no\r\nsignal coverage inside building due to no power voltage for BDA.', '1. Need active REM for this issue.\r\n2. Plan to rectify this issue with checking cable termination from markup drawing.', 1, 1, NULL, '2021-08-02 01:36:27', '2021-08-08 15:25:19');
INSERT INTO `faults` VALUES (89, 13, 'LCR-541: High VSWR value for antenna donor BDA', '1479', '2021-08-06 23:29:00', 1, '2021-08-13', 160, 'BDA', 'On 6th August 2021, at 1550hrs, FPSSB team performed plan preventive maintenance for Bi-Directional Amplifier (BDA) at building LCR-541. Visual and physical checking on junction box, BDA and antenna is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that high VSWR value on the Donor Antenna.', 'To troubleshoot on the connector antenna donor approximately 63 meters from BDA and connector at splitter approximately 4 meters from BDA.', 1, 1, NULL, '2021-08-08 15:30:07', '2021-08-08 15:30:07');
INSERT INTO `faults` VALUES (90, 13, 'SUB521: High value VSWR for donor antenna', '1487', '2021-08-11 00:19:00', 1, '2021-08-12', 129, 'BDA', 'On 12th August 2021, at 1100hrs, FPSSB team performed plan preventive maintenance for Bi-Directional Amplifier (BDA) at building SUB-521. Visual and physical checking on junction box, BDA and antenna is in good condition. Next, measure VSWR using LMR Master (Anritsu) found that VSWR value is high on the donor antenna.\r\n\r\nAntenna donor\r\nVSWR: 5.92 (<1.5 Pass Criteria)\r\nDTF-VSWR: 12.23 (<1.5 Pass Criteria)\r\n\r\n*Required to check connector antenna at rooftop building.', '1.	Need active REM for this issue.\r\n2.	Required manpower to climb at rooftop to check condition of connector antenna.\r\n3.	Captured VSWR after check and service the connector donor antenna.', 1, 1, NULL, '2021-08-11 16:20:15', '2021-08-11 16:20:15');
