INSERT INTO `faults_solutions` VALUES (1, 2, 'Accessing edge switch directly. From the configuration of the port 1 and 2 uplink of the edge switch, we found that the configuration have been replaced with errors. The new configuration replaced the wrong VLAN for both port 1 and 2.\r\nthis happen on 26th June 2019 according to the syslog of the effected switch.', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
