INSERT INTO `faults_solutions` VALUES (3, 11, 'Performed investigation by Wan Cobra (Petronas Tech) & Sapez (Rites), found Flammable Gas Alarm triggered at PAGA ZONE (PAGAZ-REFINERY-6) area.\r\nFound that alarm triggered manually by unknown at PAGA Node Tag No : FAR131-PAG-721 System A (Engineer Panel).\r\n\r\nAlarm reset and all system working fine.', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
INSERT INTO `faults_solutions` VALUES (4, 12, 'Need to configure inside Voice Gateway for \"no battery-reversal\"', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
INSERT INTO `faults_solutions` VALUES (5, 13, 'There is FUGRO apps reside within the workstation of WMS which always make a connection to the server. This to ensure that the server can provide the realtime data to the web server that is accessed by any workstation. This connection can be established by logging at the FUGRO apps.\r\nThis connection from the workstation to the server that is located at the same cabinet can be disconnect when someone remote to the server itself using Remote Desktop.\r\nTo fix this situation, the connection between FUGRO apps and the server need to be established by logging in the WMS workstation at the BLD810.', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
INSERT INTO `faults_solutions` VALUES (6, 14, 'Theres nothing wrong with the switch. Uplink (FO cable) was healthy (green LED blinking) meanwhile the downlink (CAT6 cable) was unhealthy (no LED blinking at all).  We will see the switch  port is disable due to cross cable.\r\nAfter an investigation, we found out that the patch cable is a cross (twist) cable. We advise them to change/fixed with a straight cable.\r\n\r\nthe downlink cat6 cable is not in our custody.', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
INSERT INTO `faults_solutions` VALUES (7, 15, 'Clean the virus with Malwarebytes.', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
