INSERT INTO `faults_solutions` VALUES (33, 41, '1-Patching activities and cores tested completed.\r\n2-For temporary cores 8 pairs / 16 cores to use until end of this year 2019 (PET ICT to advise) \r\n3-Refer to attachment.\r\n\r\n2/10/2019\r\nTroubleshooting 4 cores link from DCR701 to BLD810 Route A\r\n1- Clean all connector patchcord and FFP.\r\n2- Cores 7,8 found 1 pair connector at MCB602 not connected properly. Check and test dB loss the link with fluke get result (4.99 dB, 5.48 dB). Result Test Pass.\r\n3- Cores 75,76 found 1 link from WMF  to TER at BLD 810 for core 75 problem. Result test for dB Loss (9.60 dB) Fail. For this connection change to cores 77,78. Tested OK', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
