INSERT INTO `faults_solutions` VALUES (42, 50, 'Witness by Telecom PRPC UF,\r\n\r\nInform Mr. Asraf SYS 0194604925 regarding high loss above allowable limits.\r\n\r\nSYS Quality Assurance Team and Engineering to provide solution.\r\n\r\nLink Loss = [fiber length (km) x fiber attenuation per km] + [splice loss x # of splices] + [connector loss x # of connectors] + [safety margin]\r\n\r\nClosed : After rectification works by SYS Contractor.\r\nResults submit to Team project P36. Final documentation and result shall be submit to UF Telecom for review\r\n\r\n*Link Budget* \r\nFor example, Assume a ___km single mode link at 1310nm with 2 connector pairs and 1 splices.\r\n\r\n\r\nLink Loss = [__km x 0.4dB/km] + [0.1dB x 1] + [0.75dB x 2] + [3.0dB] = ____dB\r\n\r\nIn this example. an estimated ___dB of power would be required to transmit across this link. Of course, it is very important to measure and verify the actual link loss values one the link is established to identify any potential performance issues.', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
INSERT INTO `faults_solutions` VALUES (43, 51, 'FAR 142 \r\n\r\nPRPC UF need to clarify with Project Team, PL for this site.\r\n\r\nsuspect cable faulty due alarm will appear after a while resetting alarm.\r\n\r\n* To check who open the knife switch (loop being isolated)', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
INSERT INTO `faults_solutions` VALUES (44, 52, 'This alarm appears after resetting alarm.\r\n\r\nsuspected, cable leakage to earth during raining / leaks to speaker terminations box\r\ncable gland or cable isulation damage.\r\n\r\nTelecom UF need to raise this issue to Rites, IU&I projects team and EPCC.\r\n(Equipments/Cables under EPCC)', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
INSERT INTO `faults_solutions` VALUES (45, 53, '*Link Budget*\r\nLink Loss = [fiber length (km) x fiber attenuation per km] + [splice loss x # of splices] + [connector loss x # of connectors] + [safety margin]\r\n\r\nFor example, Assume a ___km single mode link at 1310nm with 2 connector pairs and 1 splices.\r\n\r\nLink Loss = [__km x 0.4dB/km] + [0.1dB x 1] + [0.75dB x 2] + [3.0dB] = ____dB\r\nIn this example. an estimated ___dB of power would be required to transmit across this link. Of course, it is very important to measure and verify the actual link loss values one the link is established to identify any potential performance issues.\r\n\r\nTesting OLTS from BLD 701 (SPJ) to BLD810 via MCB 602\r\nTotal Distance : 9.14km\r\nSplice : 4 nos\r\nConnector : 5\r\nSafety Margin: 3\r\n\r\nLink Loss = [__km x 0.4dB/km] + [0.1dB x 1] + [0.75dB x 2] + [3.0dB] = ____dB\r\nLink Loss = [9.14km x 0.4dm/km] +[0.1db x 4] + [0.75db x 5] + [0 db -not includedsafety margin]\r\n\r\nLink Loss:[ 3.656]+[0.4] + [3.75]+ [0 db -not includedsafety margin]\r\nLink Loss: 7.806db\r\n\r\nsince the testing result :-\r\ni. Leg A = 5.17db\r\nii. Leg B= 4.41db\r\n\r\nResults below expected link budget calculation', NULL, '2021-09-26 21:18:51', '2021-09-26 21:18:51');
